;; **
;;; There are many operators to perform queries:
;;; 
;;; - **:$gt** greater than
;;; - **:$lt** less than
;;; - **:$gte** greater than or equal to
;;; - **:$lte** less than or equal to
;;; - **:$eq** equal to
;;; - **:$ne** not equal to
;;; - **:$in** to test for membership of a collection
;;; - **:$nin** to test for non-membership of a collection
;;; - **:$fn** a predicate function that should return a true response for rows to keep
;;; 
;;; Furthermore with the `$where` function we can get the same result as with `query-dataset` but with arguments switched
;; **

;; @@
(->> (load-data :uk)
     (i/$where {"Election Year" {:$eq nil}})
     (i/to-map))
