;; **
;;; It's clear that all the rows are empty but one, which is a column total and must be removed. To do it we can create a new `load-data` method that loads the dataset without that row
;; **

;; @@
(defmethod load-data :uk-scrubbed [_]
  (->> (load-data :uk)
       (i/$where {"Election Year" {:$ne nil}})))
