;; **
;;; ### Mean
;; **

;; @@
(defn mean
  [xs]
  (/ (reduce + xs)
     (count xs)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ws.ch1/mean</span>","value":"#'ws.ch1/mean"}
;; <=

;; @@
(->> (load-data :uk-scrubbed)
     (i/$ "Electorate")
     (mean))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-double'>70149.94</span>","value":"70149.94"}
;; <=

;; **
;;; ### Median
;; **

;; @@
(defn median
  [xs]
  (let [n   (count xs)
        mid (int (/ n 2))]
    (if (odd? n)
      (nth (sort xs) mid)
      (->> (sort xs)
           (drop (dec mid))
           (take 2)
           (mean)))))
