;; **
;;; ### Variance
;; **

;; @@
(defn variance
  [xs]
  (let [x-bar (mean xs)
        square-deviation (fn [x]
                           (i/sq (- x x-bar)))]
    (mean (map square-deviation xs))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ws.ch1/variance</span>","value":"#'ws.ch1/variance"}
;; <=

;; **
;;; ### Standard deviation
;; **

;; @@
(defn standard-deviation
  [xs]
  (i/sqrt (variance xs)))
