;; **
;;; ### Quantiles
;; **

;; @@
(defn quantile
  [q xs]
  (let [n (dec (count xs))
        i (-> (* n q)
              (+ 1/2)
              (int))]
    (nth (sort xs) i)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ws.ch1/quantile</span>","value":"#'ws.ch1/quantile"}
;; <=

;; @@
(let [xs (->> (load-data :uk-scrubbed)
              (i/$ "Electorate"))
      f (fn [q]
          (quantile q xs))]
  (map f [0 1/4 1/2 3/4 1]))
